n = int()


# Extended Euclidean Algorithm
def extgcd(a, b):
    if b:
        d, y, x = extgcd(b, a % b)
        y -= (a // b)*x
        return d, x, y
    return a, 1, 0

# Common Modules Attack
def cma(n,e1,e2,c1,c2):
    a = extgcd(e1,e2)
    m1 = pow(c1,a[1],n)
    m2 = pow(c2,a[2],n)
    return (m1*m2) % n

